import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import Radio from "../../../components/radio/Radio";
import Nav from "../../../components/nav/Nav";
import Button from "../../../components/button/Button";


const Career=()=>{
    const [career,setCareer]=useState("Web Developer");
    const navigate=useNavigate();
    const handleChange=(e)=>{
        setCareer(e.target.value);
        console.log("handle changed to ",e.target.value);
    }
    const saveCareer=()=>{
        localStorage.setItem("career",career);
       // navigate("/education/field");

    }

    return(
        <div className="container-box">
           <h3>What is your desired career? </h3>
            <Radio id="highSchool" name="level" label="Web Developer" value="highSchool" onChange={handleChange} checked={career==="highSchool"} />
            <Radio id="bachelors" name="level" label="Software Developer" value="bachelors" onChange={handleChange} checked={career==="bachelors"}/>
            <Radio id="masters" name="level" label="Database Admin" value="masters" onChange={handleChange} checked={career==="masters"}/>
            <Radio id="doctorate" name="level" label="System Analyst" value="doctorate" onChange={handleChange} checked={career==="doctorate"}/>
            <Button className="signupBtn" label="Next" onClick={saveCareer} />
            <Nav pageName="home"/>
        </div>
    )
}

export default Career;
